main = NewTk()
main.attributes("-transparentcolor", "SystemButtonFace", "-topmost", True)
main.set_rows(1), main.set_columns(1, 1)
main.overrideredirect(True)


def exit_check():
    if is_pressed("Ctrl+F2"):
        main.destroy()
    else:
        main.after(500, exit_check)


def adjust_to_focused_window():
    focused_window = getActiveWindow()
    if focused_window and focused_window.title != main.title():
        main.geometry(
            f"{focused_window.width}x{focused_window.height}+{focused_window.left}+{focused_window.top}"
        )

    main.after(20, adjust_to_focused_window)


main.after_idle(exit_check)
main.after_idle(adjust_to_focused_window)


class ImageLabel(Label):
    def __init__(self, *args, imageData: bytes, **kwargs):
        self.imageData = imageData

        self.cImage = Image.open(BytesIO(self.imageData))
        self.photo = ImageTk.PhotoImage(self.cImage)

        super().__init__(*args, **kwargs, image=self.photo)

        main.bind("<Configure>", lambda e: self.after_idle(self.on_resize, e), add=True)

    def on_resize(self, event: Event):
        aspect_ratio = self.cImage.size[0] / self.cImage.size[1]
        new_width = event.width
        new_height = int(new_width / aspect_ratio)

        if new_height > event.height:
            new_height = event.height
            new_width = int(new_height * aspect_ratio)

        new_width, new_height = max(1, new_width // 2), max(1, new_height // 2)

        resized_image = self.cImage.resize((new_width, new_height), 0)

        self.photo = ImageTk.PhotoImage(resized_image)

        self.config(image=self.photo)
        self.image = self.photo


ImageLabel(main, imageData=wowJacData["left"]).grid(row=0, column=0, sticky="sw")
ImageLabel(main, imageData=wowJacData["right"]).grid(row=0, column=1, sticky="se")

main.mainloop()
